            user   : localStorage.getItem('user'),
            token  : localStorage.getItem('token'),
            confirm : null
        }
        const API_URL ='http://localhost:8000'
        const api     = axios.create({
            baseURL: API_URL,
            headers: {
                "Content-type": "application/json",
                "Access-Control-Allow-Origin": API_URL
            }
        })
        const url = `${API_URL}/validate-payment/`;
        axios.post(url, data).then((response) => {}).catch((e) => {window.location.replace('http://localhost:3000/failure')})
    }
    render() {
        if (this.state.confirm == null) {
            //loading
        }
        if (this.state.confirm == true) {
        return(
            <div className='container' style={{backgroundColor: configs.colors.light}}>
